import React from "react";
import {
  Box,
  Container,
  Grid,
  Typography,
  Button,
  Card,
  CardContent,
} from "@mui/material";

const ServicesSection = () => {
  const services = [
    { img: "/service-img1.jpg", title: "Garantie" },
    { img: "/service-img2.jpg", title: "Verzekering" },
    { img: "/service-img3.jpg", title: "Onze Werkplaats" },
    { img: "/service-img4.jpg", title: "Onderhoud & Service" },
  ];

  return (
    <Box component="section" className="section-2" sx={{ py: 6 }}>
      <Container maxWidth="lg">
        <Grid container spacing={3} alignItems="center" justifyContent="center">
          {/* Financiering / Lease */}
          <Grid item xs={12} md={6}>
            <Card
              sx={{
                bgcolor: "error.main",
                color: "white",
                height: 350,
                borderRadius: 3,
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
                p: 4,
              }}
            >
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  Financiering / lease
                </Typography>
                <Typography variant="body1" sx={{ mb: 2 }}>
                  Bent u geïnteresseerd in het leasen of financieren van uw
                  voertuig? Met een lease rijdt u voor een vast bedrag per maand.
                </Typography>
                <Button
                  variant="contained"
                  sx={{
                    bgcolor: "white",
                    color: "error.main",
                    "&:hover": { bgcolor: "#f9f9f9" },
                  }}
                >
                  Lees meer
                </Button>
              </CardContent>
            </Card>
          </Grid>

          {/* Hover Cards for Services */}
          {services.map((service, index) => (
            <Grid item xs={12} md={6} key={index}>
              <Box
                sx={{
                  position: "relative",
                  borderRadius: 3,
                  overflow: "hidden",
                  height: 350,
                  cursor: "pointer",
                  "&:hover .overlay": {
                    opacity: 1,
                    transform: "translateY(0)",
                  },
                }}
              >
                <img
                  src={service.img}
                  alt={service.title}
                  style={{
                    width: "100%",
                    height: "100%",
                    objectFit: "cover",
                    display: "block",
                  }}
                />

                {/* Overlay Content */}
                <Box
                  className="overlay"
                  sx={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%",
                    bgcolor: "rgba(0,0,0,0.7)",
                    color: "white",
                    display: "flex",
                    flexDirection: "column",
                    justifyContent: "center",
                    alignItems: "center",
                    opacity: 0,
                    transform: "translateY(20px)",
                    transition: "all 0.4s ease",
                    p: 3,
                    textAlign: "center",
                  }}
                >
                  <Typography variant="h6" sx={{ mb: 1 }}>
                    {service.title}
                  </Typography>
                  <Typography variant="body2" sx={{ mb: 2 }}>
                    Meer informatie over onze {service.title.toLowerCase()}.
                  </Typography>
                  <Button
                    variant="contained"
                    sx={{
                      bgcolor: "white",
                      color: "error.main",
                      "&:hover": { bgcolor: "#f9f9f9" },
                    }}
                  >
                    Lees meer
                  </Button>
                </Box>
              </Box>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default ServicesSection;
